source_string:
The following patches have been removed since the last time you used them.

${patches}

Continue anyways?

translation:
Наступныя выпраўленні былі выдалены з моманту іх апошняга выкарыстання.

${patches}

Усё роўна працягнуць?

source_string:
The version of the app you have selected does not match the suggested version which can lead to unexpected issues. Please use the suggested version.

Selected version: ${selected}
Suggested version: ${suggested}

To continue anyway, disable "Require suggested app version" in the settings.

translation:
Версія праграмы, якую вы выбралі не супадае з прапанаванай версіяй і гэта можа прывесці да нечаканых праблем. Скарыстайцеся прапанаванай версіяй.

Выбраная версія: ${selected}
Прапанаваная версія: ${suggested}

Адключыце "Патрабаваць прапанаваную версію праграмы" ў наладах, каб праігнараваць гэта паведамленне.

source_string:
Some patches require options to be set:

${patches}

Please set them before continuing.

translation:
Некаторыя выпраўленні патрабуюць зададзеных параметраў:

${patches}

Задайце іх перад працягам.

